import React from 'react';
import './MySkills.css'; // Make sure to link this CSS file for styles

const MySkills = () => {
  return (
    <div className="skills-container">
      <div className="box-card1"></div>
      <div className="box-card2"></div>
      <div className="box-card3"></div>
      <div className="box-card4"></div>
      <div className="box-card5">Card 5</div>
      <div className="box-card6">Card 6</div>
    </div>
  );
};

export default MySkills;
